import React from 'react';
import {DragDropContext, Droppable} from "react-beautiful-dnd";
import './DraggableList.css';

const DraggableList = () => {

let array = [
    {
        id: 'list-1',
        title: 'Automatic',
        thumb: '/path/to/icon'
    },
    {
        id: 'list-2',
        title: 'Automatic',
        thumb: '/path/to/icon'
    },
    {
        id: 'list-3',
        title: 'Automatic',
        thumb: '/path/to/icon'
    },
    {
        id: 'list-4',
        title: 'Automatic',
        thumb: '/path/to/icon'
    }
]

  return (
    <>
    <DragDropContext>
        <Droppable>
        {()=>{


            <ul className="myList">
                {array.map(({id, title, thumb}, index) => {
                    return (
                        <li key={id}>
                                {index+1 +". "}
                            { title }
                        </li>
                    );
                })}
            </ul>
        }}
        </Droppable>
    </DragDropContext>
    </>
  )
}

export default DraggableList;
